    /**
     * @description 验证是否为空
     * @param {Object} o 需要验证的参数
     */
    function isNull(o) {
        return o == undefined || o == "undefined" || o == null || o == '';
    }

    /**
     * @description 背景
     */
    function PageConfig() {
        return {
            BackgroundObj: {
                type: 1, //0：图片，1：颜色
                bgColor: '#f8f8f8',
                pathColor: "#f8f8f8",
                path: ''//图片，或者背景颜色
            }
        }
    }

    /**
     * @description 异步请求
     * @param {String} url 请求地址
     * @param {Object} datas 传递参数
     * @param {Function} callback 回调函数
     */
    function xsr(url, datas, callback) {
        $.ajax({
            type: "post",
            url: "PageDiv.aspx/" + url,
            data: datas,
            contentType: "application/json; charset=utf-8",
            dataType: "json",
            success: callback
        });
    }

    /**
     * @description 上传图片
     * @param {Function} callback 回调函数
     */
    function upImg(id, callback, size) {
        var fp = ($("#" + id)[0].files[0].size) / 1024;
        if (fp <= size) {
            $.ajaxFileUpload(
                {
                    url: '../../Admin/ProductManage/ajaxUpimg.aspx',
                    secureuri: false,
                    fileElementId: id,
                    dataType: 'json',
                    success: callback,
                    error: function (data, status, e) {
                    }
                });
        } else {
            alert("最大支持上传" + size + "kb");
        }
    }

    /**
     * @description 进行分页
     * @param {Int32Array} pageData 分页参数
     */
    function paging(data, dataArray, pageIndex) {
        if (dataArray.length > 0) {
            data.nowPageIndx = pageIndex;
            data.pageTotal = dataArray[0].Total % 20 > 0 ? parseInt(dataArray[0].Total / 20) + 1 : parseInt(dataArray[0].Total / 20);
            if (data.pageTotal > 1 && data.nowPageIndx < data.pageTotal) {
                data.isNextPage = true;
            } else {
                data.isNextPage = false;
            }
            if (data.pageTotal > 1 && data.nowPageIndx > 1) {
                data.isPrevPage = true;
            } else {
                data.isPrevPage = false;
            }
        }
    }

